import React, { useState } from 'react';

const Login = () => {
    
    const [name, setName] = useState
  

    return (
        <>
           <div className='login-wrapper'>
              <h2>User Login</h2>
              <div>
                <form>
                 <input
                  placeholder='Enter Your Name or Phone'
                  name='name'
                  type='text'
                  value={name}
                  onChange={(e)=>setName(e.target.value)}                 
                  > 
                 </input>
                
                
                
                </form>

              </div>
           </div> 
        </>
    );
}

export default Login;
